// Navigation.js

import React from "react";
import { Link } from "react-router-dom";

export const Navigation = () => {
  const navContainerStyle = {
    backgroundColor: "#2196f3", // Blue background color
    color: "#fff",
    padding: "15px",
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
  };

  const logoStyle = {
    margin: "0",
    fontSize: "14px",
  };

  const navlinksStyle = {
    display: "flex",
  };

  const navButtonStyle = {
    margin: "0",
    padding: "0px",
    color: "#fff",
    border: "none",
    textDecoration: "none",
    cursor: "pointer",
  };

  const homeButtonStyle = {
    ...navButtonStyle,
    backgroundColor: "#FFA500", // Orange button color for Home
  };

  const logoutButtonStyle = {
    ...navButtonStyle,
    backgroundColor: "#FF0000", // Red button color for Logout
  };

  const navButtonHoverStyle = {
    backgroundColor: "#FF0000", // Red background color on hover
    borderRadius: "5px",
  };

  return (
    <div style={navContainerStyle}>
      <div style={logoStyle}>
        <h1>PHARMACIST</h1>
      </div>
      <div style={navlinksStyle}>
        <Link to="/logout">
          <button style={homeButtonStyle}>Home</button>
        </Link>
        <Link to="/">
          <button style={{ ...logoutButtonStyle, ...navButtonHoverStyle }}>
            Logout
          </button>
        </Link>
      </div>
    </div>
  );
};
